import React from 'react';
import Aux from './Aux';
import Book from './Book';
import Styles from './css/main.module.css'

const Shelf= (props)=>{
    const {books} = props

    return(
        <Aux>
            <div>
                <h1>{props.name}</h1>
                <div className={Styles.shelf}>
                {books.map((b)=>(
                    <li key={b.key}>
                        <Book/>
                    </li>

                ))}

                </div>
            </div>
        </Aux>
    )
}

export default Shelf
